import TeamColorLogo from "../../../utils/TeamColors";

function PlayerPick( props ) {
    return (
        <div className="player-pick-card">
            <TeamColorLogo teamName={props.teamName} />
            <p>{props.web_name}</p>
        </div>
    )
}

export default PlayerPick;
